yle="font-family:'ArialMT', 'Arial', sans-serif;font-size:36px;fill:#fff;" id="text14">is the creature's lair<tspan x="374.907px " y="663.277px " id="tspan12">.</tspan></text></g><g transform="matrix(1,0,0,1,306.957,137.598)" id="g26"><text x="65.901px" y="507.744px" style="font-family:'ArialMT', 'Arial', sans-serif;font-size:36px;fill:#fff;" id="text18">It looks abandoned</text><text x="65.901px" y="544.922px" style="font-family:'ArialMT', 'Arial', sans-serif;font-size:36px;fill:#fff;" id="text20">to me.</text><text x="65.901px" y="594.1px" style="font-family:'ArialMT', 'Arial', sans-serif;font-size:36px;fill:#fff;" id="text22">Can anyone live in</text><text x="65.901px" y="631.277px" style="font-family:'ArialMT', 'Arial', sans-serif;font-size:36px;fill:#fff;" id="text24">such a place?</text></g><text x="73.124px" y="2264.57px" style="font-family:'ArialMT', 'Arial', sans-serif;font-size:36px;fill:#fff;" id="text30">Go to the end of the corridor<tspan x="521.401px " y="2264.57px " id="tspan28">.</tspan></text><clipPath id="_clip1"><rect x="0" y="1748.3" width="800" height="451.8" id="rect32"/></clipPath><g clip-path="url(#_clip1)" id="g42"><clipPath id="_clip2"><rect x="0" y="1748.3" width="800" height="451.8" id="rect35"/></clipPath><g clip-path="url(#_clip2)" id="g40"><use xlink:href="#_Image3" x="0" y="1749.08" width="800px" height="451.8px" transform="matrix(1,0,0,0.999558,0,0)" id="use38"/></g></g><path d="M766.18,84.214l-55.912,96.309l26.671,3.17l-13.268,21.081l-25.694,-3.053l-39.769,68.913l-50.411,-5.991l40.328,-68.847l-30.023,-3.568l13.268,-21.081l28.068,3.335l35.124,-58.419l-61.303,-7.285l-8.848,13.676l-27.789,-3.302l28.519,-51.699l141.039,16.761Z" style="fill:#fff;fill-rule:nonzero;" id="path44"/><a id="a81" xlink:href="https://forms.gle/qVqXMRFYZpdKmccG8"><rect x="429.193" y="1932.53" width="32.693" height="27.82" style="fill:#fff;fill-opacity:0.01;" id="rect46"/></a><a id="a78" target="_blank" xlink:href="https://youtu.be/WpmhkxlnySc"><use xlink:href="#_
